\newcommand{\ud}{\mathrm{d}}

$$\lambda = - \frac{\Delta P [MW]}{\Delta f [Hz]} \quad \text{(bias factor)}$$
\begin{align*}
 \Delta P = \sum_i \Delta P_{g_i} & = \sum_i \left(- \frac{1}{R_{g_i}} \cdot \frac{P_{g_{i,r}}}{f_r} \cdot \Delta f \right) \\
 \Rightarrow \lambda = - \frac{\Delta P}{\Delta f} & = \sum_i \left(\frac{1}{R_{g_i}} \cdot \frac{P_{g_{i,r}}}{f_r}\right)
 \end{align*}
